import React from 'react';
import '../styles/app.css'
import aboutMePic from '..assets/aboutMePic.jpeg'

function AboutMe(){
    return (
        <div class = 'aboutMe'> 
            <p> Welcome to my website! This is Ahmed speaking. I'm a rising second year that goes to Villanova University! 
                Majoring in Computer Engineering, I look to focus and concetrate on software applications, 
                specifically full-stack applications embedded with artifical intelligence and cybersecurity. 
                Feel free to hit the contact me through email or filling out a form (check header). Check out the rest 
                of my page for my experience, projects, and resume! </p>

                <img src = {aboutMePic} alt = 'aboutMePic'> </img>
        </div>


    );
}

export default AboutMe;
